import LineButton from "./LineButton.js";
import "./SelectLine.css"
export default function SelectLine() {
    return (<div>
        <LineButton color="Gold"/>
        <LineButton color="Red"/>
        <LineButton color="Blue"/>
        <LineButton color="Green"/>
    </div>);
}
